import React from "react";

function deleteButton(props){
props.onDelete();

}

function Note(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={deleteButton}>DELETE</button>
    </div>
  );
}

export default Note;
